import React, { Component } from 'react';
import './UserCard.css';

class UserCard extends Component {

  constructor (props) {
    super(props);

    this.state = {
      username: '',
      submitted: false,
      userData: '',
    };
  }

  render () {
    return (
      <img src={this.props.userData.avatar_url}/>
    )
  }
}

export default UserCard;
